# main.py - Copy this entire file
from fastapi import FastAPI, HTTPException
from fastapi.middleware.cors import CORSMiddleware
from pydantic import BaseModel
from deepface import DeepFace
import base64
import numpy as np
from io import BytesIO
from PIL import Image
import uvicorn

app = FastAPI()

# Enable CORS for frontend
app.add_middleware(
    CORSMiddleware,
    allow_origins=["*"],
    allow_credentials=True,
    allow_methods=["*"],
    allow_headers=["*"],
)

# ========== PASTE YOUR BASE64 STRINGS HERE ==========
TARGET_STUDENTS_BASE64 = {
    "haroon": "",
    "shahan": ""
}

# Request/Response Models
class AttendanceRequest(BaseModel):
    group_image: str

class AttendanceResponse(BaseModel):
    success: bool
    faces_detected: int
    present: list
    absent: list
    message: str

# Store loaded faces
TARGET_FACES = {}

# Load faces when server starts
@app.on_event("startup")
async def load_faces():
    print("Loading target faces...")
    for name, b64_string in TARGET_STUDENTS_BASE64.items():
        try:
            img_bytes = base64.b64decode(b64_string)
            img = Image.open(BytesIO(img_bytes))
            img_array = np.array(img)
            
            faces = DeepFace.extract_faces(img_path=img_array, enforce_detection=True)
            if faces:
                TARGET_FACES[name] = faces[0]['face']
                print(f"‚úÖ Loaded: {name}")
        except Exception as e:
            print(f"‚ùå Error loading {name}: {e}")

# Home endpoint
@app.get("/")
def home():
    return {
        "status": "API is running",
        "students": list(TARGET_FACES.keys())
    }

# Main attendance endpoint
@app.post("/check-attendance")
async def check_attendance(request: AttendanceRequest):
    try:
        # Decode group image
        img_data = request.group_image
        if 'base64,' in img_data:
            img_data = img_data.split('base64,')[1]
        
        img_bytes = base64.b64decode(img_data)
        group_img = Image.open(BytesIO(img_bytes))
        group_array = np.array(group_img)
        
        # Find faces in group photo
        group_faces = DeepFace.extract_faces(img_path=group_array, enforce_detection=True)
        
        # Check each face
        present = []
        for face_data in group_faces:
            face = face_data['face']
            best_match = None
            best_distance = float('inf')
            
            # Compare with all target students
            for student_name, target_face in TARGET_FACES.items():
                try:
                    result = DeepFace.verify(
                        face, 
                        target_face, 
                        model_name="Facenet512", 
                        enforce_detection=False
                    )
                    if result['distance'] < best_distance:
                        best_distance = result['distance']
                        best_match = student_name
                except:
                    pass
            
            # If good match found
            if best_distance < 0.7:
                present.append(best_match)
        
        # Get unique present students
        present = list(set(present))
        absent = [s for s in TARGET_STUDENTS_BASE64.keys() if s not in present]
        
        return AttendanceResponse(
            success=True,
            faces_detected=len(group_faces),
            present=present,
            absent=absent,
            message=f"{len(present)} out of {len(TARGET_STUDENTS_BASE64)} students present"
        )
        
    except Exception as e:
        raise HTTPException(status_code=400, detail=str(e))

if __name__ == "__main__":
    uvicorn.run(app, host="0.0.0.0", port=8000)


app =app
